È risaputo che un livello alto di colesterolo può essere pericoloso per la salute, ma sai esattamente che cos’è il colesterolo?
Il colesterolo presente nel nostro corpo è una sostanza grassa prodotta dal fegato, ma si trova anche in cibi come carne, latticini e uova.
Non ci crederai ma il colesterolo svolge una funzione vitale nella formazione delle cellule e nella produzione di vitamina D, ormoni e bile per la digestione.
Tuttavia, un tasso elevato di colesterolo nel sangue può aumentare il rischio di infarto cardiaco, ictus, aterosclerosi e altri disturbi cardiaci e per questo è molto importante controllarne i livelli.
Ed è qui che la filosofia Herbalife per una vita sana e attiva può venirti in aiuto con il Beta Heart.

